//--------------------------
// ** hide / show / togle html element

function showElement(e){
  e.style.display = 'block'
}

function hideElement(e){
  e.style.display = 'none'
}

function togleElement(e){
  if( e.style.display != 'none' )
	  e.style.display = 'none'
  else 
	  e.style.display = 'block'
}

//---------------------
// ** switch to fullscreen mode 

function fullScreen(e){
    if(e==undefined)e = document.body;
	if(e.webkitRequestFullScreen)
		e.webkitRequestFullScreen();
	else if(e.mozRequestFullScreen)
		e.mozRequestFullScreen();
	else if(e.msRequestFullScreen)
		e.msRequestFullScreen();
}   

//----------------------------------------------
// ** return a random number in [a,b[
//    if b is undefined: return a number in [-a,a[
//    if a and b are undefined: return a number in [-1,1[

function rnd(a,b){
	if(a==undefined){a=-1;b=1}
	else if(b==undefined){b=-a}
	return a+(b-a)*Math.random();
}

function rndInt(a,b){
	return Math.floor(rnd(a,b))
}

function rndDecide(p){
	return (rnd(0,1)<=p)
}

function sat(v,a,b){
	if(v<=a)return a
	if(v>=b)return b
	return v
}

//-- rects has center (x,y) and half dims: w,h 
function intersectRects(A,B){
	let res = (A.x-A.w >= B.x+B.w)||  // B:::A
	          (B.x-B.w >= A.x+A.w)||  // A:::B
			  (A.y-A.h >= B.y+B.h)||  // A / B
	          (B.y-B.h >= A.y+A.h)   // B / A  
    return !res			  
}


var rate = 44100 

var audio_context = undefined

var isPlaying = false

var sndBom = [makeBom(69000,0.9999,400),makeBom(69000,0.9999,950),makeBom(69000,0.9999,660),makeBom(69000,0.999,460),]

function makeBom(N=8000,g=0.96,L=400){
	
	let snd = new Float32Array(N)
	
	let a =1
	let v = 0
	const d = 1.0 / N
	let lop = 0.1
	
	for(let k=0;k<snd.length;k++,a*=g,lop+=0.06-0.1*lop)
	{
		v = v*lop+(1-lop)* a  * rnd()
		snd[k] = (1-k*d)*v-0.9*(k>L?snd[k-rndInt(0.95*L,L)]:0)
	}
	
	return snd
	
}

function playSnd(buf){
  initAudio()
  if(isPlaying)return
  isPlaying=true
  setTimeout(function(){isPlaying=false},300)
  var source  = audio_context.createBuffer(1,buf.length,rate);
  source.copyToChannel(buf,0,0);
  var oup = audio_context.createBufferSource();
  oup.buffer = source;
  oup.connect(audio_context.destination);
  oup.start(0);
}

function makeSound(fr){
	if(fr==undefined) fr = 500
	let snd = new Float32Array(60000)
	let a =1
	let th =0
	let dth = Math.PI*2*fr/rate
	const dth0 = Math.PI*4*fr/rate
	for(let k=0;k<snd.length;k++){
		snd[k] = sat(0.1*th,0,1)*Math.sin(th)*a
		th += dth
		dth += 0.001*(dth0-dth)
		a *=0.99883
	}
	return snd
}

function initAudio(){
	if(!audio_context) audio_context = new AudioContext();
}

}
const vertexShader = 
`
attribute vec2 a_Position;
	
attribute vec4 color;

attribute vec2 texco;

varying vec2 texc;

varying vec2 pos;

varying vec4 clr;

void main(){
   
   vec2 cf = vec2(1.0, 16.0/9.0);
   
   gl_Position =  vec4(a_Position*cf,0.0,1.0);
   
   clr  = color;
   
   pos  = a_Position;
   
   texc = texco;
   
}
	
`
const fragmentShader =
`
precision mediump float;

uniform float tm;
uniform float X;
uniform float Y;
 
varying vec4 clr;

varying vec2 texc;

varying vec2 pos ;

uniform sampler2D txMonster;

uniform sampler2D txRand;

void main(){
   
   float x = X+pos.x;
   float y = Y+pos.y;
   
   if(texc.x<1.0)  // not a stone
	gl_FragColor =   clr  *  texture2D(txMonster,texc)  ; 
   
   else
   {
	   float cf = (texc.x<2.0)?4.3243:3.0;
	   vec2 q = 0.001*vec2( sin(10.1*(y-x)-tm*14.0)*cos( 13.3*x+ 9.0*tm ),
							sin(11.1*(x-y)+tm*13.0)*cos( 15.5*y+ 8.0*tm )
					      );
	   gl_FragColor =  clr*     texture2D(txMonster,q+ 0.123*sin( cf*(pos+vec2(X,Y)))+vec2(0.625,0.625)) ; 
   }
   
}

`

	

const MAX_VERTEX_NUM = 10000
var vNum = 0
var ctx ,prog, vbuf, cbuf, tbuf;
const vArr= new Float32Array(MAX_VERTEX_NUM * 2)
const cArr= new Float32Array(MAX_VERTEX_NUM * 4)
const tArr= new Float32Array(MAX_VERTEX_NUM * 2)


 window.onresize = function(){
	const w = window.innerWidth
	const h = window.innerHeight
	const ratio = 9.0/16.0
	if(w*ratio<h){
		can.height = h
		can.width = h/ratio
	}else {
		can.width = w
		can.height = w*ratio
	}	
	ctx.viewport(0,0,can.width,can.height);
		
	console.log("can: w="+can.width+"  h:"+can.height)
}
			
	 
	 
	 function setUnif(name,value){
		let loc = ctx.getUniformLocation(prog,name)
		ctx.uniform1f(loc,value)
	 }
	 
	 
	//--------------------------------
	// ** newBuffer: creates a buffer and bind it to attribute 'name'
    function newBuffer(name,size){
		var p = ctx.getAttribLocation(prog,name);
		var buffer = ctx.createBuffer(); 
		ctx.bindBuffer(ctx.ARRAY_BUFFER,buffer); 
		ctx.enableVertexAttribArray(p);
		ctx.vertexAttribPointer(p,size,ctx.FLOAT,false,0,0); 
		return buffer;
	} 	
	
	//---------------------------------
	// ** setBuffer: sets the vbalues in buffer 
    function setBuffer(buffer,values){
		ctx.bindBuffer(ctx.ARRAY_BUFFER,buffer);
		ctx.bufferData(ctx.ARRAY_BUFFER,values,ctx.STATIC_DRAW);
	}
	
	//--------------------------------
	function initGL(){
		
		can.oncontextmenu = function(){return false} 
		ctx = can.getContext("webgl");
        ctx.enable(ctx.BLEND);
		ctx.blendFunc(ctx.SRC_ALPHA, ctx.ONE_MINUS_SRC_ALPHA);
		console.log(ctx);
		var  VShader = createShader(ctx,ctx.VERTEX_SHADER,vertexShader);
		var  FShader = createShader(ctx,ctx.FRAGMENT_SHADER,fragmentShader);
	    prog = ctx.createProgram();
		ctx.attachShader(prog,VShader);
		ctx.attachShader(prog,FShader);
		ctx.linkProgram(prog);
		var res = ctx.getProgramParameter(prog,ctx.LINK_STATUS);
		if(res)
		    console.log("shaders compiled successfuly.");
		else {
		console.log("error compiling shaders!");
		return;
		}
		//ctx.viewport(0,0,ctx.canvas.width,ctx.canvas.height);
		ctx.viewport(0,0,can.width,can.height);
		ctx.useProgram(prog);
		//------- create buffers & texture
	    vbuf = newBuffer("a_Position",2); // 2 coordinates per vertex
	    cbuf = newBuffer("color",4);      // 4 color components per vertex
	    tbuf = newBuffer("texco",2);      // 2 texture coordinates per vertex		
	
	}

	//--------------------------------
	
	function createShader(gl,type,src){
	     var shader = gl.createShader(type);
		 gl.shaderSource(shader,src);
		 gl.compileShader(shader);
		 var res = gl.getShaderParameter(shader,gl.COMPILE_STATUS);
		 if(res)return shader;
	}
	
    
//---------------------------------
// ** newTex: creates a texture from an image object
function newTex(image){
 let tex = ctx.createTexture();
 ctx.bindTexture(ctx.TEXTURE_2D,tex);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_WRAP_S, ctx.CLAMP_TO_EDGE);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_WRAP_T, ctx.CLAMP_TO_EDGE);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_MIN_FILTER, ctx.LINEAR);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_MAG_FILTER, ctx.LINEAR);
 ctx.texImage2D(ctx.TEXTURE_2D,0,ctx.RGBA,image.width, image.height, 0, ctx.RGBA, ctx.UNSIGNED_BYTE,new Uint8Array(image.data)); 
 return tex;
}

//---------------------------------
function copyArr(dest,pos,src){
	for(let i=0;i<src.length&&pos<MAX_VERTEX_NUM;i++,pos++)
			dest[pos]=src[i]
}

//---------------------------------
// ** drawAll
function drawAll(){
	setBuffer(vbuf,  vArr ) 
	setBuffer(cbuf,  cArr ) 
	setBuffer(tbuf,  tArr )
		  
	ctx.drawArrays(ctx.TRIANGLES,0,vNum);
	 
	vNum=0
}
 
var aspectRatio,
    World={},
	Camera={},
	CollisionBlocks=[] 
 
function initWorld(width,height){
	 
	aspectRatio   = can.height *1.0/ can.width
	World.width   = width
	World.height  = height
	World.hWidth  = width/2
	World.hHeight = height/2
	Camera.x = 0
	Camera.y = 0
	Camera.w = 0.2
	Camera.h = Camera.w * aspectRatio 
	Camera.maxX = World.hWidth  - 1
	Camera.maxY = World.hHeight - aspectRatio
}

function updateCamera(player)
{
	if(player.x-Camera.x>Camera.w)
		Camera.x=player.x-Camera.w
	else
	if(player.x-Camera.x<-Camera.w)
		Camera.x=player.x+Camera.w
	
	if(player.y-Camera.y>Camera.h)
		Camera.y=player.y-Camera.h
	else
	if(player.y-Camera.y<-Camera.h/2)
		Camera.y=player.y+Camera.h/2
	
	Camera.x = sat( Camera.x, -Camera.maxX,Camera.maxX)
	Camera.y = sat( Camera.y, -Camera.maxY,Camera.maxY)
}
/*---------------------------------------*
 
               Sprite Class
			
 *---------------------------------------*/
function Sprite(x,y,w,h,tx){
	this.tx = tx
	this.x  = x
	this.y  = y
	this.vx = 0
	this.vy = 0
	this.ax = 0
	this.ay = 0
	this.width = w
	this.height = h
	this.w = w/2
	this.h = h/2
	this.color = [1,1,1,1]
	this.th = rnd(Math.PI)
	
	//----------------------------------------
	//-- calculate distance to another sprite
	this.distTo=function(sp){
		let a = sp.x-this.x
		let b = sp.y-this.y
		return Math.sqrt(a*a+b*b)
	}
	
	this.speed=function(){
		return Math.sqrt(this.vx*this.vx+this.vy*this.vy)
	}
	
	this.flipH=function(dir){
		let i=Math.min(this.tx[1],this.tx[3])
		let j=Math.max(this.tx[1],this.tx[3])
		if(dir<0){
			this.tx[1]=i
			this.tx[3]=j
		}else{
			this.tx[1]=j
			this.tx[3]=i
		}
	}
	
	//----------------------------------------------
	//-- checks the new position (newx,newy) for 
	//   collisions with blocks & world edges,
	//   then adjusts the new position
	this.checkCollision=function(newx,newy){
		
		const rh ={x:newx,y:this.y,w:this.w,h:this.h}
		const rv ={x:this.x,y:newy,w:this.w,h:this.h}
		
		const  sx = Math.sign(this.vx)
		const  sy = Math.sign(this.vy)
		const eps = 0.0001
		
		//-- collisions with blocks
		for(let i=0;i<CollisionBlocks.length;i++){
			let c = CollisionBlocks[i]
			
		    if(sx!=0&&intersectRects(rh,c)) 
				rh.x = c.x-sx*(eps+c.w+this.w)
			else 
			if(sy!=0&&intersectRects(rv,c)) 
				rv.y = c.y-sy*(eps+c.h+this.h)
		}
		newx = rh.x
		newy = rv.y
		
		//-- detect world edge
		
		if(newx+this.w>World.hWidth||newx-this.w<-World.hWidth)
				newx = sx * (World.hWidth-this.w-eps)
			
		if(newy+this.h>World.hHeight||newy-this.h<-World.hHeight)
				newy = sy * (World.hHeight-this.h-eps)
			
		//-- assign new position
				
		this.x= newx
		this.y= newy
	}

}

//--------------------------------------------
// add sprite vertices to vertex buffer 
// and add colors & texture coordinates to attribute buffers

function addSpriteToBuf(sprite,scalex=1,scaley=1,rotation=0){
	let x = sprite.x - Camera.x
	let y = sprite.y - Camera.y
	if(x-sprite.width>1||x+sprite.width<-1
	   ||y+sprite.height<-1||y-sprite.height>1)return
	   
	let w = sprite.width *0.5*scalex
	let h = sprite.height*0.5*scaley
	const th = sprite.th+rotation
	let c = Math.cos( th )  
	let s = Math.sin( th )
	let px =  c*w-s*h
	let py =  s*w+c*h
	let qx = -c*w-s*h
	let qy = -s*w+c*h
	
	let coords = [
					x+px,y+py,
					x+qx,y+qy,
					x-px,y-py,
					x+px,y+py,
					x-px,y-py,
					x-qx,y-qy 
					]
					
	 
	copyArr(vArr,vNum*2,coords)
	
	//vArr=vArr.concat(coords)
	
    let txcoords = [sprite.tx[2],sprite.tx[1],
					sprite.tx[0],sprite.tx[1],
					sprite.tx[0],sprite.tx[3],
					sprite.tx[2],sprite.tx[1],
					sprite.tx[0],sprite.tx[3],
					sprite.tx[2],sprite.tx[3]
					]
    copyArr(tArr,vNum*2,txcoords)
	
    for(let k=0;k<6;k++,vNum++)					
	  copyArr(cArr,vNum*4,sprite.color)
    
}

//-- add an array of sprites to be drawn
function addSprites(sps){
	for(let k=0;k<sps.length;k++)
		addSpriteToBuf(sps[k])
}


//-- explosion animation 

const explosions = []
const explosionMax = 20
var explosionCur =0

var sparks=[]

function startSpark(pos1,pos2){
	let d = pos1.distTo(pos2)
	let p = new Sprite(pos2.x,pos2.y,
	                   2*d,2*d,
					   
					  [0,0.5,0.5,1])
	p.color[3]=0.5
	p.th=Math.atan2(pos2.x-pos1.x,pos2.y-pos1.y)
	sparks.push(p)
}

function updateSparks(){
	for(let k=0;k<sparks.length;k++){
		let p = sparks[k]
		p.color[3]-=1.0/(60.0*2)
		let q={x:p.x,y:p.y}	
		for(let i=0;i<14;i++){
		
		p.color[0]=rnd(0.5,1)
		p.color[1]=rnd(0.5,1)
		p.color[2]=rnd(0.5,1)
		p.x =q.x+ rnd(0.051)
		p.y =q.y+ rnd(0.051)
		p.flipH(rnd())
		addSpriteToBuf(p,rnd(0.5,1),rnd(0.5,1),rnd(Math.PI))
		
		}
		p.x=q.x
		p.y=q.y
	}
	for(let k=0;k<sparks.length;k++){
		if(sparks[k].color[3]<=0){
			sparks.splice(k,1)
			break
		}
	}
}

function startExplosion(sp){
	
	
	for(let k=0;k<40;k++){
		let p = new Sprite(sp.x, sp.y, 
	                  0.1*sp.width, 0.1*sp.height, 
					  [])
		let a = sp.tx[0]
		let b = sp.tx[1]
		let aa = sp.tx[2]
		let bb = sp.tx[3]
		p.tx=[rnd(a,0.5*(aa+a)),rnd(b,0.5*(bb+b)),
		      rnd(0.5*(aa+a),aa),rnd(0.5*(bb+b),bb)]
		p.color=[1,1,1,1]
		p.vx=0.51*rnd()
		p.vy=0.51*rnd()
		explosions[explosionCur]=p
	    explosionCur++
	    if(explosionCur>=explosionMax)explosionCur=0 
	}

	
	 
}

function explosionsUpdate(dt){
	for(let k=0;k<explosions.length;k++)
	{
		let p = explosions[k]
		if(!p||p.color[3]<0.01)continue
		p.x+=p.vx*dt
		p.y+=p.vy*dt
		if(p.color[3]>0)
			p.color[3]-=1.0/(3.0*60.0)
		p.th+=dt*rnd(10,22)
		addSpriteToBuf(p)
	}
}

//------------------------------------------------
function drawScene (){
	  
	  if(!animOn)return
	  
	  if(then==undefined){
		  then=Date.now()
		  requestAnimationFrame(drawScene)
		  return
	  }
	  
	  if(playerLife<=0){
		const p = new Sprite(0,0,2,32.0/9.0,[0.5,0,1,0.5])
		gameEnded = true
		Camera.x=0
		Camera.y=0
		p.th=0
		addSpriteToBuf(p)
		drawAll()
		results.innerHTML=""
		results1.innerHTML="you were cooked by monsters and they ate you!<br>Double click to restart game"
		showElement(trackers)
		return
	  }
	  
	  if((monNum!=undefined)&&monNum<=0){
		const p = new Sprite(0,0,2,32.0/9.0,[0.75,0.5,1,0.75])
		gameEnded = true
		Camera.x=0
		Camera.y=0
		p.th=0
		addSpriteToBuf(p)
		drawAll()
		results.innerHTML=""
		results1.innerHTML="Congratulations!!<br> You killed all monsters !<br>Double click to restart game"
		showElement(trackers)
		return
	  }
	  
	  let time = Date.now() 
	  var dt = 0.001*(time-then)
	  dt=sat(dt,1.0/90,1.0/40)
	  then=time;
		 
		
		updateCamera(player)
		setUnif('X',Camera.x)
		setUnif('Y',Camera.y)
		setUnif('tm',time/1000.0)
			
		
		
		//-- enque background to drawing 
		addSpriteToBuf(backgroundSp)
		
		//-- enque walls to drawing 
		addSprites(CollisionBlocks) 
		
	  //-- update Monsters ---
	  monNum=0
		for(let k=0;k<monsters.length;k++)
		{
			let mon = monsters[k]
			
			if(mon.state==='dead')continue
			monNum++
			
			//-- detect bombas 
			for(let i=0;i<bombas.length;i++)
				if(bombas[i].distTo(mon)<bombas[i].w*2)
				{
					mon.state='dead'
					playSnd(sndBom[rndInt(0,sndBom.length)])
					startSpark(mon,bombas[i])
					startExplosion(mon)
					break
				}
				
			let r =  0.1+0.01*k
			if(rndDecide(0.3))
			{ 
				let rn =rnd(0.4,1.6)
				let d = mon.distTo(player)
				mon.ax = rn*(player.x-mon.x)*dt*32/(0.01+d)
				mon.ay = rn*(player.y-mon.y)*dt*32/(0.01+d)
			}
			 
			 
			mon.vx+=mon.ax*dt
			mon.vy+=mon.ay*dt
			let sx = mon.x+ mon.vx*dt
			let sy = mon.y+ mon.vy*dt
			mon.checkCollision(sx,sy)
				 
			
			mon.vx*=0.993/(1+0.01*mon.speed())
			mon.vy*=0.993/(1+0.01*mon.speed())
			 
			const rr =  1.0+0.023*Math.sin(mon.frq*time*0.008)
			let sclx = rr
			let scly =1.0/rr 
			mon.th+=dt*rnd(0.9,1.6)
			
			if( intersectRects(mon,player) )
			{
				if(time>prevSnd+100){
					playSnd(snd)
					playerLife--
					prevSnd=time
				}
					
			}
			addSpriteToBuf(mon,sclx,scly)
		}
		//-- update bombas
		for(let k=0;k<bombas.length;k++){
			let bom = bombas[k]
			const rr =  1.0+0.063*Math.sin(bom.frq*time*0.008)
			let sclx = rr
			let scly =1.0/rr 
			addSpriteToBuf(bom,sclx,scly)
		}
		
		//-- update green Monsters ---
		for(let k=0;k<greenMonsters.length;k++)
		{
			let mon = greenMonsters[k]
			
			if(mon.state==='dead')continue
			monNum++
			
			//-- detect bombas 
			for(let i=0;i<bombas.length;i++)
				if(bombas[i].distTo(mon)<bombas[i].w*2)
				{
					mon.state='dead'
					playSnd(sndBom[rndInt(0,sndBom.length)])
					startSpark(mon,bombas[i])
					startExplosion(mon)
					break
				}
				
			let r =  0.1+0.01*k
			if(rndDecide(0.3))
			{ 
				let rn =rnd(0.4,1.6)
				let d = mon.distTo(player)
				mon.ax= rn*(player.x-mon.x)*dt*32/(0.01+d)
				mon.ay= rn*(player.y-mon.y)*dt*32/(0.01+d)
			}
			 
			 
			mon.vx+=mon.ax*dt
			mon.vy+=mon.ay*dt
			
			let sx = mon.x+ mon.vx*dt
			let sy = mon.y+ mon.vy*dt
			mon.checkCollision(sx,sy)
				 
			mon.vx*=0.993/(1+0.01*mon.speed())
			mon.vy*=0.993/(1+0.01*mon.speed())
			 
				
			const rr =  1.0+0.063*Math.sin(mon.frq*time*0.008)
			let sclx = rr
			let scly =1.0/rr 
			mon.th+=dt*rnd(0.9,1.6)
			
			if( intersectRects(mon,player) )
			{
				if(time>prevSnd+100){
					playSnd(snd)
					playerLife--
					prevSnd=time
				}
					
			}
			addSpriteToBuf(mon,sclx,scly)
		}
		
		//-- update player 
		if(Mouse.btn>0){
			player.vx  =  5* (  Mouse.x-player.x  )
			player.vy  =   5* (  Mouse.y-player.y  )
			Mouse.btn -=  0.2*dt
		} 
		 if(Key.pressed()){
			 Mouse.btn =0
			 player.vx   =  10* (Key.right-Key.left) 
			 player.vy   =  10* (Key.up-Key.down) 
		 }
		const maxV = 3.0
		let v = player.speed()
			
			if(v>maxV){
				v=maxV/v
				player.vx *=v
				player.vy *=v
			}
		const gv = Math.exp(-5*dt)
		player.vx  *= gv 
		 player.vy  *= gv
		
		player.th =  Math.PI+ Math.atan2(player.vy,player.vx)  
			
			player.flipH(player.vx)
			 
			let newx = player.x +  dt * player.vx
			let newy = player.y +  dt * player.vy
			
			player.checkCollision(newx,newy)
			 
			
			const th = time * 0.009
			const tt = 1.0+0.2*Math.sin(th )
			addSpriteToBuf(player,tt,1/tt,0)
			
		//-- explosions
		updateSparks()
		explosionsUpdate(dt)	
        
        //-- stats --
        if(animOn){ 
			results.innerHTML ="fps:"+ Math.round(1.0/(dt+0.0001))
			    +"<br>sprites:"+vNum/6
				+"<br>life:"+playerLife
				+"<br>monsters:"+monNum
				+"<br>[p] or [2fingers]:pause/resume<br>[t] or [3fingers]:hide/show text"
				+"<br> right click : full screen"
            requestAnimationFrame(drawScene);
        }else results.innerHTML="Click To Start";
		
		//-- send queue to webgl --
			drawAll()
}

function startAnim(){
	animOn=true
	requestAnimationFrame(drawScene)
}

function pauseAnim(){
	animOn=false
	then=undefined
}

function togleAnim(){
	if(animOn)pauseAnim()
	else startAnim()
}

	let waitmessage = document.getElementById('waitmessage')
	document.body.removeChild(waitmessage)
	trackers.onclick="";
	initGL()
	initData()
